import React from 'react';
import '../style.css'
import {
    BrowserRouter,
    Switch,
    Route,
    Link,
    Redirect,
  } from "react-router-dom";


class ProfileCard extends React.Component {

    render() {
        return (
            <div class="perfilInfoBox">
                        <img src="../images/mode_edit.png" class="edit"/>
                        <h3>Dados do cliente</h3>
                        <div id="photoAndName">
                            <img class="image" src={this.props.imgSrc}/>
                            <p>{this.props.name}</p>
                        </div>
                        <div id="perfilInfo">
                            <div id="perfilInfoLabels">
                                <p>ID</p>
                                <p>Endere√ßo</p>
                                <p>Telefone</p>
                                <p>Email</p>
                                <p>CPF</p>
                            </div>
                            <div id="perfilInfoContent">
                                <p id="ID">{this.props.id}</p>
                                <p id="endereco">{this.props.address}</p>
                                <p id="telefone">{this.props.phone}</p>
                                <p id="email">{this.props.email}</p>
                                <p id="cpf">{this.props.cpf}</p>
                            </div>
                        </div>
                    </div>
        );
    }
}

export default ProfileCard;
